    "2015-06-19T15:50:10.893580",nt"name": "michigan-georef-naip-dgital-ortho-photo-image",nt"isopen":
    false,nt"url": null,nt"notes": "This data set contains 1-meter resolution
    imagery derived from the 2005 National Agriculture Imagery Program (NAIP) statewide
    aerial imagery acquisition. Data have been repositioned to the Michigan GeoRef coordinate
    system. Each image is a three band, natural color digital orthoimage acquired during
    the agricultural growing season of 2005 (June - August). This orthoimage meets horizontal
    National Map Accuracy Standards (NMAS) at a scale of 1:12,000 (+/- 33.33 feet).
    The tiling format (image extent) is based on a 3.75' x 3.75' quarter-quadrangle.
    NAIP specifications allow for as much as 10% cloud cover per tile",nt"license_title":
